import { stringArrayToObject } from './utils';

export const actions = stringArrayToObject(['MOVE']);

const privateActionCreators = {
  move(move, indexGrid, indexRow, board) {
    return {
      type:'MOVE',
      payload: { move, indexGrid, indexRow, board }
    };
  }
};

export const actionCreators = {
  move(move, indexGrid, indexRow, board) {
    return privateActionCreators.move(move, indexGrid, indexRow, board);
  }
};
